import React from 'react';
import PropTypes from 'prop-types';

Logo.propTypes = {};

function Logo() {
  return (
    <div>
      <a href="#">
        <img src="./img/common/logo.svg" alt="Logo"/>
      </a>
    </div>
);
}

export default Logo;
